import React from "react";
const TokenGenerate = () => {
  const tokenGenerateHandler = () => {};
  return (
    <>
      <div>
        <button type="button" onClick={tokenGenerateHandler}>
          Token Generate
        </button>
      </div>
    </>
  );
};

export default TokenGenerate;
